<script>
    $(function () {
        var open = false;
        $('#menu_btn').on('click', function () {
            if (!open) {
                $('.project_menu').removeClass('close');
                $('.img_wrap img').addClass('close');
                $('#project_ul').removeClass('close');
            } else {
                $('.project_menu').addClass('close');
                $('.img_wrap img').removeClass('close');
                $('#project_ul').addClass('close');
            }
            open = !open;
        });
    });

</script>
